	(674,309,122,'Delete https://www.youtube.com/watch?v=UfQSALNKWJU&amp;ab_channel=Oscars','text',NULL,NULL,'<a class=\"message-preview d-block rounded mt-2 mb-1 overflow-hidden text-left\" target=\"_blank\" href=\"https://www.youtube.com/watch?v=UfQSALNKWJU\"><div class=\"preview-image\" style=\"background-image: url(\'https://i.ytimg.com/vi/UfQSALNKWJU/sddefault.jpg\')\"></div><div class=\"p-2\"><h6 class=\"text-body mb-1 font-weight-bolder\">Whoopi Goldberg &amp; Bryan Stevenson | Academy Dialogues: The Power of Narrative</h6><p class=\"text-body mb-1 p\">A conversation with Academy Governor Whoopi Goldberg and civil rights lawyer Bryan Stevenson, founder and executive director of the Equal Justice Initiative, on how narrative storytelling is at the heart of recovery in addressing racial and ethnic inequity. This conversation touches on the need for Hollywood to own its place as the historic purveyor of hurtful tropes and storylines that led to harmful imagery and stereotypes about ethnically and racially diverse communities. How will Hollywood move forward in its storytelling? Moderated by Shawn Finnie, Associate Director of Member Relations and Outreach. Subscribe for more @Oscars videos ►► http://osca.rs/subscribeyt #AcademyDialogues is a new series of virtual panels for members and the public, as a part of Academy Aperture 2025, called “Academy Dialogues: It Starts with Us,” with conversations about race, ethnicity, gender, history, opportunity and the art of filmmaking. These discussions focus on the industry-wide systemic changes that are needed to...</p><span class=\"text-gray\">www.youtube.com</span></div></a>',NULL,1,0,NULL,'1600757945673','2020-09-22 16:59:05','2020-09-22 17:51:53',NULL),
