	(681,298,114,'https://hackintosher.com/guides/get-hackintosh-audio-working/','text',NULL,NULL,'<a class=\"message-preview d-block rounded mt-2 mb-1 overflow-hidden text-left\" target=\"_blank\" href=\"https://hackintosher.com/guides/get-hackintosh-audio-working/\"><div class=\"preview-image\" style=\"background-image: url(\'https://hackintosher.com/wp-content/uploads/2017/06/Kabylake-Hackintosh-Sierra-Audio.jpg\')\"></div><div class=\"p-2\"><h6 class=\"text-body mb-1 font-weight-bolder\">This is how to get Hackintosh audio working - Hackintosher</h6><p class=\"text-body mb-1 p\">This guide contains instructions on how to get audio working on a CoffeeLake/KabyLake/SkyLake hackintosh, aswell as older motherboard chipsets. This guide covers the new ALC1220 codec, as well as other codecs such as ALC1150, 892, 887, and the ASUS S1220A. If you followed one of our audio should already be working for you and you don’t need to follow this guide. This guide uses the AppleALC method which is the easiest way to get audio working for beginners without tampering with the files of macOS and it’s the easiest way to debug if there is a problem. Other methods can be difficult to</p><span class=\"text-gray\">hackintosher.com</span></div></a>',NULL,1,0,NULL,'1600762629891','2020-09-22 18:17:09','2020-10-09 18:39:50',NULL),
